import { Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import AddWords from "./pages/AddWords";

function App() {
  return (
    <div className=" flex flex-col items-center bg-[url(https://www.google.com/url?sa=i&url=https%3A%2F%2Fhwp.com.tr%2Fnissan-skyline-gt-r-r34-acik-artirmaya-cikiyor-239072&psig=AOvVaw2Sh4RWEMvpLIYc5wNvHjyc&ust=1709372526010000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCOjktIPj0oQDFQAAAAAdAAAAABAE)]">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/addwords" element={<AddWords />} />
      </Routes>
    </div>
  );
}

export default App;
